import React from "react";
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

import StateDrop from "./StateDrop";

const Address = ({ setForm, formData, setStep }) => {
  const { address, city, state, zip } = formData;

  return (
    <div className="form">
      <h3>Address</h3>
      <TextField
        label="Address"
        name="address"
        value={address}
        onChange={setForm}
      />
      <TextField label="City" name="city" value={city} onChange={setForm} />
      <StateDrop label="State" name="state" value={state} onChange={setForm} />
      <TextField label="Zip" name="zip" value={zip} onChange={setForm} />
      <div>
        <Button onClick={setStep('Name')}>Previous</Button>
        <Button onClick={setStep('Contact')}>Next</Button>
      </div>
    </div>
  );
};

export default Address;
